import BaseButton from "./BaseButton";
import BaseCheckbox from "./BaseCheckbox";

import BaseTable from "./BaseTable";

import Modal from "./Modal";
import CloseButton from "./CloseButton";
import DropDown from "./Dropdown.vue";


let components = {
  Card,
  BaseInput,
  SidebarPlugin,
  BaseButton,
  BaseCheckbox,
  BaseTable,

  Modal,
  CloseButton,
  DropDown,

};

export{
  Card,
  BaseInput,
  SidebarPlugin,
  BaseButton,
  BaseCheckbox,
  BaseTable,

  Modal,
  CloseButton,
  DropDown,

}
